import React from "react";
import InputFiled from "../../inputFiled/inputFiled";
import {
  CleanButton,
  MainButton,
  SecondaryButton,
} from "../../Styled_Components/Buttons";
import "./SingInPage.css";
const SingINPage = () => {
  const navigation: any = useNavigate();
  return (
    <div className="main">
      <div className="singINCard">
        <div className="info">
          <span>SING IN</span>
          <p>To continue the order, please sign in</p>
        </div>
        <div className="inputField">
          <InputFiled label={"Email address"} />
          <InputFiled label={"Password"} />
        </div>
        <div className="logInForgetPassword">
          <MainButton isActive={true} className="singUpButtons">
            login
          </MainButton>
          <CleanButton className="forgetPass">Forget password?</CleanButton>
        </div>
        <div className="orDiv">
          <hr />
          <span>or</span>
          <hr />
        </div>
        <SecondaryButton
          isActive={true}
          onClick={() => {
            navigation("singUp");
          }}
          className="singUpButtons"
        >
          sign up
        </SecondaryButton>
      </div>
    </div>
  );
};
export default SingINPage;
